DROP TABLE IF EXISTS "indicator_father_son";
CREATE TABLE "indicator_father_son" ("indicatorfather_id" integer, "indicatorson_id" integer);
DROP TABLE IF EXISTS "indicator_scores";
CREATE TABLE "indicator_scores" ("id" INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL, "indicator_id" integer, "scoredate_id" integer, "score" float, "created_at" datetime NOT NULL, "updated_at" datetime NOT NULL, "goal" float DEFAULT 0.0);
DROP TABLE IF EXISTS "indicators";
CREATE TABLE "indicators" ("id" INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL, "name" varchar(255), "weight" float, "objective_id" integer, "created_at" datetime NOT NULL, "updated_at" datetime NOT NULL, "operation_id" INTEGER DEFAULT null);
DROP TABLE IF EXISTS "indicators_objectives";
CREATE TABLE "indicators_objectives" ("indicator_id" integer, "objective_id" integer);
DROP TABLE IF EXISTS "objective_scores";
CREATE TABLE "objective_scores" ("id" INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL, "objective_id" integer, "scoredate_id" integer, "score" float, "created_at" datetime NOT NULL, "updated_at" datetime NOT NULL);
DROP TABLE IF EXISTS "objectives";
CREATE TABLE "objectives" ("id" INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL, "name" varchar(255), "weight" float, "perspective_id" integer, "created_at" datetime NOT NULL, "updated_at" datetime NOT NULL);
DROP TABLE IF EXISTS "operations";
CREATE TABLE "operations" ("id" INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL, "name" varchar(255), "operator" varchar(1), "firstoperand" integer, "secondoperand" integer, "created_at" datetime NOT NULL, "updated_at" datetime NOT NULL);
DROP TABLE IF EXISTS "perspective_scores";
CREATE TABLE "perspective_scores" ("id" INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL, "perspective_id" integer, "scoredate_id" integer, "score" float, "created_at" datetime NOT NULL, "updated_at" datetime NOT NULL);
DROP TABLE IF EXISTS "perspectives";
CREATE TABLE "perspectives" ("id" INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL, "name" varchar(255), "weight" float, "created_at" datetime NOT NULL, "updated_at" datetime NOT NULL);
DROP TABLE IF EXISTS "raw_data";
CREATE TABLE "raw_data" ("id" INTEGER PRIMARY KEY  NOT NULL ,"name" varchar(255),"operation_id" integer,"created_at" datetime NOT NULL ,"updated_at" datetime NOT NULL , "default_value" FLOAT DEFAULT null);
DROP TABLE IF EXISTS "raw_data_scores";
CREATE TABLE "raw_data_scores" ("id" INTEGER PRIMARY KEY  NOT NULL ,"scoredate_id" integer,"value" float,"rawdata_id" integer,"created_at" datetime NOT NULL ,"updated_at" datetime NOT NULL );
DROP TABLE IF EXISTS "roles";
CREATE TABLE "roles" ("id" INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL, "name" varchar(255), "resource_id" integer, "resource_type" varchar(255), "created_at" datetime NOT NULL, "updated_at" datetime NOT NULL);
DROP TABLE IF EXISTS "schema_migrations";
CREATE TABLE "schema_migrations" ("version" varchar(255) NOT NULL);
DROP TABLE IF EXISTS "score_dates";
CREATE TABLE "score_dates" ("id" INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL, "month" integer, "year" integer, "created_at" datetime NOT NULL, "updated_at" datetime NOT NULL);
DROP TABLE IF EXISTS "users";
CREATE TABLE "users" ("id" INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL, "email" varchar(255) DEFAULT '' NOT NULL, "encrypted_password" varchar(255) DEFAULT '' NOT NULL, "reset_password_token" varchar(255), "reset_password_sent_at" datetime, "remember_created_at" datetime, "sign_in_count" integer DEFAULT 0, "current_sign_in_at" datetime, "last_sign_in_at" datetime, "current_sign_in_ip" varchar(255), "last_sign_in_ip" varchar(255), "created_at" datetime NOT NULL, "updated_at" datetime NOT NULL, "name" varchar(255));
DROP TABLE IF EXISTS "users_roles";
CREATE TABLE "users_roles" ("user_id" integer, "role_id" integer);
CREATE INDEX "index_roles_on_name" ON "roles" ("name");
CREATE INDEX "index_roles_on_name_and_resource_type_and_resource_id" ON "roles" ("name", "resource_type", "resource_id");
CREATE UNIQUE INDEX "index_users_on_email" ON "users" ("email");
CREATE UNIQUE INDEX "index_users_on_reset_password_token" ON "users" ("reset_password_token");
CREATE INDEX "index_users_roles_on_user_id_and_role_id" ON "users_roles" ("user_id", "role_id");
CREATE UNIQUE INDEX "unique_schema_migrations" ON "schema_migrations" ("version");
